script: |
  super -f text -I q3693.spq | sort > q3693.out

inputs:
  - name: q3693.spq
    data: |
      SELECT ALL - col0 / col0 FROM tab2 (FORMAT parquet) cor0 WHERE - col0 NOT BETWEEN ( + col1 + - 0 ) AND ( NULL );
  - name: tab2

outputs:
  - name: q3693.out
    data: |
      -1
      -1
      -1
